          "id": "1d2a8220f77743b03ff85c6a7083b8ee22534f44",
          "message": "Merge #1930 #1993\n\n1930: fix(client): retry only once when check-replicas test query fails due to diff responses r=joshuef a=bochaco\n\n- Re-enabling e2e sn_client tests multi-threaded mode.\r\n- If a connection times out right after we sent a msg, but before we try to finish the stream, since we donâ€™t await for the `finish` result we miss the chance to detect it and retry with new conn. This was made this way to avoid the await, but it seems, that at least for the client, we may want to wait for the `finish` result so we can retry in such scenarios.\r\n- Retrying a test query only once, and only if the failure was due to receiving different responses from the data replicas, which may be due to a temporary out of sync. We've seen this very occasionally in CI with Register queries/entries.\n\n1993: Misc Release Process Updates r=joshuef a=jacderida\n\n- 2badf68d6 **ci: add arm builds to merge workflow**\r\n\r\n  We seen a failure on a release because an ARM build failed. The failure occurred because the `cross`\r\n  utility (which we use for cross compilation) wouldn't build correctly. Strangely, I wasn't able to\r\n  reproduce this problem, but I think it highlights the need for building on ARM before we merge. If\r\n  we are going to release on every merge, we will need to check that we can build on ARM.\r\n  \r\n- bfc96acdc **ci: slack notifications for workflow failures**\r\n\r\n  We didn't become aware of our latest release workflow failure for weeks after the event, so I've\r\n  enabled notifications for failures of either the version bumping or release workflows.\r\n  \r\n- d14f34bde **ci: add sn_comms crate to the release process**\r\n\r\n  This new crate is added to all the necessary mechanisms for the release process.  \n\nCo-authored-by: bochaco <gabrielviganotti@gmail.com>\nCo-authored-by: Chris O'Neil <chriso83@protonmail.com>",
